query:
query GetSearchResults($countryCode: String!, $currencyCode: CurrencyCode!, $filtersVersion: Int, $page: BrowsePageInput, $query: String!, $sort: BrowseSortInput, $staticRanking: BrowseExperimentStaticRankingInput, $list: String, $skipVariants: Boolean!, $marketName: String) {
  browse(
    query: $query
    page: $page
    sort: $sort
    filtersVersion: $filtersVersion
    experiments: {staticRanking: $staticRanking}
  ) {
    categories {
      id
      name
      count
    }
    results {
      edges {
        objectId
        node {
          ... on Product {
     title
   styleId
  gender
   id
            listingType
            urlKey
            primaryTitle
            secondaryTitle
            media {
              smallImageUrl
            }
            brand
            productCategory
            market(currencyCode: $currencyCode) {
              state(country: $countryCode, market: $marketName) {
                numberOfCustodialAsks
                lowestCustodialAsk {
                  amount
                }
              }
            }
            favorite(list: $list)
            variants @skip(if: $skipVariants) {
              id
            }
          }
          ... on Variant {
            id
            product {
              id
              listingType
              urlKey
              primaryTitle
              secondaryTitle
              media {
                smallImageUrl
              }
              brand
              productCategory
            }
            market(currencyCode: $currencyCode) {
              state(country: $countryCode, market: $marketName) {
                numberOfCustodialAsks
                lowestCustodialAsk {
                  amount
                }
              }
            }
          }
        }
      }
      pageInfo {
        limit
        page
        pageCount
        queryId
        queryIndex
        total
      }
    }
    sort {
      id
      order
    }
  }
}
